import "../Table.css"
import TableContainer from '@mui/material/TableContainer';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import Grid from '@mui/material/Grid';


export const SunriseSunset = ({forecast}) => {
    return (
        <div>
            <h1>Today's weather in {forecast.location.name}, {forecast.location.region}</h1>
            <Grid>
                <TableContainer component = {Paper}>
                    <Table sx={{ maxWidth: 300 }} aria-label="simple table">
                        <TableRow className = "TableRow"><img src = {forecast.current.condition.icon}/><p>{forecast.current.condition.text}</p></TableRow>
                        <TableRow className = "TableRow">Sunrise: {forecast.forecast.forecastday[0].astro.sunrise}</TableRow>
                        <TableRow className = "TableRow">Sunset: {forecast.forecast.forecastday[0].astro.sunset}</TableRow>
                        <TableRow className = "TableRow">Moonrise: {forecast.forecast.forecastday[0].astro.moonrise}</TableRow>
                        <TableRow className = "TableRow">Moonset: {forecast.forecast.forecastday[0].astro.moonset}</TableRow>
                    </Table>
                </TableContainer>
            </Grid>
        </div>
    )
}
